import React from 'react'

function Test(props) {
  return (
    <div>
        {/* <p>bill number :{props.bn}</p> */}
        <p>product id :{props.pid}</p>
        <p>product quantity : {props.pq}</p>
        <p>product costs: {props.pc}</p> 
        <br/>    
    </div>
  )
}

export default Test
